import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className='home'>
        <div className='home-main'>
            <img className='img1' src='https://images.pexels.com/photos/11191002/pexels-photo-11191002.jpeg?auto=compress&cs=tinysrgb&h=590&w=442.5'/>
            <img className='img1' src='https://images.pexels.com/photos/6414006/pexels-photo-6414006.jpeg?auto=compress&cs=tinysrgb&h=590&w=442'/>
            <img className='img1' src='https://images.pexels.com/photos/6011218/pexels-photo-6011218.jpeg?auto=compress&cs=tinysrgb&h=590&w=442'/>
            <img className='img1' src='https://images.pexels.com/photos/10977593/pexels-photo-10977593.jpeg?auto=compress&cs=tinysrgb&dpr=&h=590&w=442'/>
        </div>
        <div className='main-content'>
                <p>Welcome To SnapLib Photography</p>
                <p>Capture your best memories with our Expert Photographers.</p>
            </div>
    </div>
  )
}

export default Home;
